import React from 'react';

const SideBar = () => {
  const list = ["My Coaches", "Conflict Resolution"]
  return (
    <>
      <div className="dropdown">
        <img src="/images/SideBar.png" data-toggle="dropdown" alt="" height="40px" width="30px" className="SideBar" />
        <div className="dropdown-menu">
          <div className="row Profile">
            <img src="/images/Ellipse.png" alt="" height="100%" width="50%" /> <br />
          </div>
          <div className="ProfileName">
            Plff Jenkins
          </div>
          {list && list.map((item, index) => (
            <>
              <div className="ProfileList col-sm-4" key={index}>
                {item}
              </div>
            </>
          ))}
        </div>
      </div>
    </>
  );
};

export default SideBar;
